import React from "react";
import { useNavigate } from "react-router-dom";

function Freelancers() {

  const navigate = useNavigate();

  // 60 Freelancer Dataset
  const freelancers = Array.from({ length: 60 }, (_, i) => ({
    id: i + 1,
    name: `Freelancer ${i + 1}`,
    skill: skills[i % skills.length],
    rating: (4 + Math.random()).toFixed(1),
    price: `$${20 + i}/hr`,
    img: `https://i.pravatar.cc/150?img=${(i % 70) + 1}`
  }));

  // Hire Button Action
  const hireFreelancer = (freelancer) => {
    localStorage.setItem(
      "hiredFreelancer",
      JSON.stringify(freelancer)
    );

    alert(`You hired ${freelancer.name} ‚úÖ`);

    navigate(`/freelancer/${freelancer.id}`);
  };

  return (
    <div style={styles.page}>
      <h1 style={styles.heading}>
        Browse Freelancers üë©‚Äçüíª
      </h1>

      <div style={styles.container}>
        {freelancers.map((f) => (
          <div key={f.id} style={styles.card}>

            <img src={f.img} alt={f.name} style={styles.image} />

            <h3>{f.name}</h3>

            <p>{f.skill}</p>

            <p>‚≠ê {f.rating}</p>

            <p style={styles.price}>{f.price}</p>

            <button
              style={styles.button}
              onClick={() => hireFreelancer(f)}
            >
              Hire Now
            </button>

          </div>
        ))}
      </div>
    </div>
  );
}

// Skills Pool
const skills = [
  "Full Stack Developer",
  "Java Developer",
  "React Developer",
  "UI/UX Designer",
  "Mobile App Developer",
  "Data Scientist",
  "Digital Marketer",
  "Content Writer",
  "Graphic Designer",
  "DevOps Engineer"
];

const styles = {
  page: {
    minHeight: "100vh",
    padding: "40px",
    background: "linear-gradient(135deg,#1d2671,#c33764)",
    color: "white",
    textAlign: "center"
  },

  heading: {
    marginBottom: "30px"
  },

  container: {
    display: "grid",
    gridTemplateColumns:
      "repeat(auto-fit, minmax(220px, 1fr))",
    gap: "25px"
  },

  card: {
    backdropFilter: "blur(15px)",
    background: "rgba(255,255,255,0.1)",
    borderRadius: "15px",
    padding: "20px",
    boxShadow: "0 8px 32px rgba(0,0,0,0.3)",
    border: "1px solid rgba(255,255,255,0.2)",
    transition: "0.3s"
  },

  image: {
    width: "90px",
    height: "90px",
    borderRadius: "50%",
    border: "3px solid white",
    marginBottom: "10px"
  },

  price: {
    fontWeight: "bold",
    margin: "10px 0"
  },

  button: {
    padding: "10px 15px",
    border: "none",
    borderRadius: "20px",
    background:
      "linear-gradient(45deg,#ff416c,#ff4b2b)",
    color: "white",
    fontWeight: "bold",
    cursor: "pointer"
  }
};

export default Freelancers;
